import logo from './WindowNewsLogo.svg';
import searchLogo from './search.svg';
import colourInverter from './ColourInverter.svg';
import './App.css';
import './card.css';
import './header.css';
import './footer.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}


// Footer 

function Footer(props) {
  const { headingLevel } = this.props;
  const Title = headingLevel;

  return (
    <div className="footer">

      <div className="footer__resources">
        <Title></Title>
        <Title></Title>
        <InputField />
      </div>
      <Title className="footer__copyright"></Title>


    </div>

  )
}

function InputField() {
  const { labelName, headingLevel } = this.props;
  const Title = headingLevel;
  return (
    <Title className="footer__resourceItem">
      <label className="footer__resourceItem">{labelName}</label>
      <input className="footer__resourceItem"></input>
    </Title>

  )
}

export default App;
